    public static void verifyStoragePermissions(Activity activity) {
        int permission = ActivityCompat.checkSelfPermission(activity, Manifest.permission.WRITE_EXTERNAL_STORAGE);
        if (permission != PackageManager.PERMISSION_GRANTED) {
            ActivityCompat.requestPermissions(
                    activity,
                    PERMISSIONS_STORAGE,
                    1
            );
        }
    }

    protected void chooseImage()
    {
        verifyStoragePermissions(this);
        Intent intent = new Intent(Intent.ACTION_PICK, android.provider.MediaStore.Images.Media.EXTERNAL_CONTENT_URI);
        intent.putExtra("crop", "true");
        intent.putExtra("aspectX" , 1);
        intent.putExtra("aspectY", 1);
        intent.putExtra("outputX", TOTAL_FAN_SIZE_PIXELS*2);
        intent.putExtra("outputY", TOTAL_FAN_SIZE_PIXELS*2);
        startActivityForResult(intent, 1);
    }

    protected void onActivityResult(int requestCode, int resultCode, Intent intent){
        super.onActivityResult(requestCode, resultCode, intent);
        if(resultCode==RESULT_OK && requestCode == 1 && intent != null)
        {
            Uri selectedImage = intent.getData();
            ImagePreview.setImageURI(selectedImage);
            ImageBitmap = Bitmap.createScaledBitmap(((BitmapDrawable)ImagePreview.getDrawable()).getBitmap(), TOTAL_FAN_SIZE_PIXELS*2,TOTAL_FAN_SIZE_PIXELS*2, true);
            ImagePreview.setImageBitmap(ImageBitmap);
        }
    }

    protected void setBit(byte[] ByteArray, int position, boolean value, int frameNo) {
        int byteLocation = position / 8 + frameNo*NUMBER_OF_BYTES_PER_FRAME;
        int bitLocation = 7 - (position % 8);
        byte tempByte = ByteArray[byteLocation];
        if (value)
            tempByte = (byte) (tempByte & ~(1 << bitLocation));
        else
            tempByte = (byte) (tempByte | (1 << bitLocation));
        ByteArray[byteLocation] = tempByte;
    }

    protected int getTHRESHOLD_VALUE(Bitmap temperBitmap)
    {
        long sum = 0;
        int len = 0;
        for (int i = 0; i < TOTAL_FAN_SIZE_PIXELS*2;i += threskip)
        {
            for (int j = 0; j < TOTAL_FAN_SIZE_PIXELS*2; j+= threskip)
            {
                sum+=(Color.red(temperBitmap.getPixel(i,j))+Color.green(temperBitmap.getPixel(i,j))+Color.blue(temperBitmap.getPixel(i,j)));
                len+=1;
            }

        }
        Toast.makeText(getApplicationContext(), "Threshold set to " + sum/len, Toast.LENGTH_LONG).show();
        return((int)sum/len);
    }
    protected byte[] convertImage(Bitmap tempBitmap)
    {
        THRESHOLD_VALUE=getTHRESHOLD_VALUE(tempBitmap);
        byte[] ConvertedImage = new byte[(NUMBER_OF_SCAN_LINES*ACTUAL_FAN_SIZE_PIXELS)/8];
        for (int i = 0;i<NUMBER_OF_SCAN_LINES;i++)
        {
            for(int j=0;j<ACTUAL_FAN_SIZE_PIXELS;j++)
            {
                setBit(ConvertedImage, (i*ACTUAL_FAN_SIZE_PIXELS+j),getBinary(tempBitmap, X[j][i],Y[j][i]), 0);
            }
        }
        //put following code at the end of convert video fuinction later
        byte tempByte;
        for (int i = 0;i<(ConvertedImage.length);i+=4)
        {
            tempByte=ConvertedImage[i];
            ConvertedImage[i]=ConvertedImage[i+3];
            ConvertedImage[i+3]=tempByte;
            tempByte=ConvertedImage[i+1];
            ConvertedImage[i+1]=ConvertedImage[i+2];
            ConvertedImage[i+2]=tempByte;
        }
        //done with endian code

        ByteStreamImage=ConvertedImage; //remove this line for video
        return(ConvertedImage);
    }
    protected boolean getBinary(Bitmap tempestBitmap, int x, int y)
    {
        int Pixel = tempestBitmap.getPixel(x,y);
        return(((Color.red(Pixel)+Color.green(Pixel)+Color.blue(Pixel))>THRESHOLD_VALUE));
    }
    protected void saveImage()
    {
        verifyStoragePermissions(this);
        File f = new File(Environment.getExternalStorageDirectory(),
                "/test");
        try {
            f.createNewFile();
        } catch (IOException ex) {
            Log.e("io", ex.getMessage());
        }
        try {
            FileOutputStream fos = new FileOutputStream(f);
            fos.write(ByteStreamImage);
            Toast.makeText(getApplicationContext(),"File Saved!!", Toast.LENGTH_LONG).show();
        } catch(FileNotFoundException ex)
        {
            System.out.println("FileNotFoundException : " + ex);
        }
        catch(IOException ioe)
        {
            System.out.println("IOException : " + ioe);
        }
    }

